import "./App.css";
import axios from "axios";
import { useState, useEffect } from "react";

function App() {
  const getPhotos = async () => {
    try {
      const res = await axios.get("https://loremflickr.com/320/240/dog​");
      console.log(res.data);
    } catch (err) {
      console.log(err);
    }
  };
  useEffect(() => {
    getPhotos();
  }, []);

  return <>hello</>;
}

export default App;
